// frontend/src/pages/admin/ActivitiesLog.jsx
import React from 'react';

const ActivitiesLog = () => {
  return (
    <div style={{ padding: '2rem' }}>
      <h1>سجل الأنشطة</h1>
      <div className="alert alert-info">
        <p>صفحة سجل الأنشطة قيد التطوير</p>
        <p>سيتم عرض جميع أنشطة النظام قريباً</p>
      </div>
    </div>
  );
};

export default ActivitiesLog;
